DROP TABLE IF EXISTS `report_datasource`;
CREATE TABLE `report_datasource`  (
                                      `id` bigint(20) NOT NULL COMMENT '主键id',
                                      `merchant_no` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商户号',
