                                      `type` tinyint(4) NULL DEFAULT NULL COMMENT '数据库类型 1mysql 2oracle 3 sqlserver 4api',
                                      `driver_class` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '驱动',
